“Скандинавия” - это сеть современных многопрофильных клиник в Санкт-Петербурге, которая видит своей миссией помогать пациенту приумножать здоровье эффективно и комфортно.

“Скандинавия - Личный кабинет” - это приложение, которое собирает всю информацию о вашем здоровье в одном месте. Теперь она всегда под рукой - удобно и просто:

- Результаты всех анализов и другой диагностики, заключения и назначения врачей;
- Мгновенная онлайн-запись на прием;
- Телемедицинские онлайн консультации с врачом;
- Информация о ближайших приемах и подготовке к ним;
- Медицинские карты родственников;
- Обратная связь.

Чтобы получить доступ к приложению обратитесь к администратору клиники с любым документом, удостоверяющем личность.

